import React from 'react'
import { useParams } from 'react-router-dom'
import { useState, useEffect } from 'react'
import axios from 'axios'


export default function RavintolaIDnakyma() {

    const [ravintolat, setRavintolat] = useState([]);
    useEffect(() => {
      const getRavintolat = async () => {
      const results = await axios.get('https://dummyjson.com/products') 
    
      console.log(results.data.products);
    
      setRavintolat(results.data.products);
      }
    
        getRavintolat();
    }, []);

    const id = useParams();
    console.log(id);
    const ravintola = ravintolat.find(n => n.id === id.id);
    if (ravintola == null){
        return <div>No matching ravintola</div>
    }
  return (
      <div>
          <div>Täältä löytyy ravintola {ravintola.name}  tiedot.
                {ravintola.address}
          </div>
      </div>
    
  )
}
